import styled from '@emotion/styled';

const Styled = styled.header`
background-image: linear-gradient(#54b4eb,#2fa4e7 60%,#1d9ce5);
`

function Header(props) {
  return (
    <Styled>
      <a>Voter Package</a>
    </Styled>
  );
}

export default Header;
